import React from "react";
import "./App.css";

import {
  Blogs,
  Features,
  Footer,
  Header,
  Possibility,
  Gpt3,
} from "./container";
import { Brand, Cta, Navbar } from "./components";

const App = () => {
  return (
    <div className="App">

    <Navbar></Navbar>
 
 <Header/>
      <Brand></Brand>
      <Gpt3></Gpt3>
      <Features></Features>
      <Possibility></Possibility>
      <Cta></Cta>
      <Blogs></Blogs>
      <Footer></Footer>
    </div>
  );
};

export default App;
